create table nts_device_data
(
    id                  bigint auto_increment comment '编号'
        primary key,
    device_sn           varchar(60)          null comment '设备SN',
    gps_lock_state      varchar(30)          null comment 'GPS锁定状态 LOCKED UNLOCKED COMM_ERROR',
    gps_satellite_count int                  null comment 'GPS卫星数',
    gps_last_lock       int                  null comment 'GPS上次锁定',
    gps_latitude        varchar(30)          null comment 'GPS纬度',
    gps_longitude       varchar(30)          null comment 'GPS经度',
    geofence_code       varchar(20)          null comment '地图围栏码',
    mcc                 varchar(10)          null comment '移动国家码',
    mnc                 varchar(10)          null comment '移动网络码MNC',
    lac                 varchar(20)          null comment '本地区域码',
    cid                 varchar(20)          null comment '移动网络码CID',
    rssi                varchar(20)          null comment '蜂窝网信号强度',
    ext_power           varchar(5)           null comment '是否外部电源',
    ext_power_voltage   varchar(10)          null comment '外部电源电压',
    battery_voltage     varchar(10)          null comment '电池电压',
    device_temp         varchar(10)          null comment '设备内部温度(摄氏)',
    rtdl_on             varchar(5)           null comment '是否实时下载启用',
    ver_fw              varchar(30)          null comment '设备的固定版本',
    device_type         varchar(20)          null comment '设备类型',
    dept_id             bigint               null comment '部门|企业ID',
    delete_flag         tinyint(1) default 1 null comment '删除标志 1-正常状态 2-已删除',
    create_time         datetime             null comment '创建时间',
    update_time         datetime             null comment '更新时间'
)
    comment '设备数据表';

create index index_device_data
    on nts_device_data (device_sn);

